import React from "react";
import '../Techs/Techs.css';

function Techs() {
  return (
    <section className="techs">
      <h2 className="techs__title">Технологии</h2>
      <h3 className="techs__heading">7 технологий</h3>
      <p className="techs__subtitle">На курсе веб-разработки мы освоили 
      технологии, которые применили в дипломном проекте.</p>
      <div className="techs__tools">
        <p className="techs__tools-name">HTML</p>
        <p className="techs__tools-name">CSS</p>
        <p className="techs__tools-name">JS</p>
        <p className="techs__tools-name">React</p>
        <p className="techs__tools-name">Git</p>
        <p className="techs__tools-name">Express.js</p>
        <p className="techs__tools-name">mongoDB</p>
      </div>
    </section>
  );
}
export default Techs;
